import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import About from "./Componants/About"

function App() {
  return (
    <>
      <Router>
      <Routes>
      <Route exact path='/'/>
      <Route exact path='/about' element={<About/>}/>
      </Routes>
        </Router>    
    </>
  );
}

export default App;
